CREATE TABLE IF NOT EXISTS `world_cities_table`(
  city VARCHAR(33) DEFAULT NULL
, city_ascii VARCHAR(39) DEFAULT NULL
, lat NUMERIC(12,9) DEFAULT NULL
, lng NUMERIC(13,9) DEFAULT NULL
, pop NUMERIC(10,1) DEFAULT NULL
, country VARCHAR(32) DEFAULT NULL
, iso2 VARCHAR(3) DEFAULT NULL
, iso3 VARCHAR(3) DEFAULT NULL
, province VARCHAR(43) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
